import React from 'react'
import {Link} from "react-router-dom";

export default function FullPriziv(props) {

const surname = props.match.params.surname
const {prizivnik} = props
console.log(surname)
//console.log(prizivnik, surname)

return (
<div>
    {prizivnik
    .filter(prizivnik => prizivnik.surname === surname)
    .map(prizivnik =>
    <div key={prizivnik.id}>
        <ul>
            <li>
                <Link to="/">Призывники</Link> / <Link to={`/${prizivnik.surname}`}>{prizivnik.surname}</Link>
            </li>
        </ul>
        <h1>{prizivnik.surname}</h1>
        Имя: {prizivnik.name}
        <br/>Отчество: {prizivnik.patronymic}
        <br/>Возраст: {prizivnik.vozrast}
        <br/>Категория: {prizivnik.categoriya}
        <br/>Отсрочка: {prizivnik.otsrochka}
        <br/>Адрес: {prizivnik.adress}
    </div>
    )}
</div>
)
}
